export function serviceAreasFromCounties(counties: string[]) {
  return chain(counties)
    .map(_ => COUNTIES_TO_ZIPS[_].map(z => serializeServiceArea('tx', _, z)))
    .flatten()
    .value()
}

/** TODO: Move to utils */
export let countiesFromZip = memoize((zip: string) => {
  return chain(COUNTIES_TO_ZIPS)
    .toPairs()
    .filter(([_, v]) => v.includes(zip))
    .map(([k]) => k)
    .value()
})

/** TODO: Move to utils */
export let zipsFromCounty = (county: string) =>
  COUNTIES_TO_ZIPS[county]
